`,stats:{STR:4,DEX:11,CON:12,INT:2,WIS:12,CHA:5}},{id:"eweb4fynq",name:"Balor",hp:262,AC:19,type:"fiend",speed:40,speedSwim:10,speedFly:80,immunities:["Fire","Poison","Poisoned"],resistances:["Cold","Lightning; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks"],vulnerabilities:[],savingThrows:["STR +14","CON +12","WIS +9","CHA +12"],skills:[],senses:["Truesight 120 ft.","Passive Perception 13"],challenge:"19 (22,000 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/175/1000/1000/636252761612038117.jpeg",size:"huge",alignment:"chaotic evil",isPlayer:!1,notes:`
