`,stats:{STR:17,DEX:10,CON:15,INT:12,WIS:11,CHA:15}},{id:"r04zgrxnl",name:"Boar",hp:11,AC:11,type:"beast",speed:40,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Passive Perception 9"],challenge:"1/4 (50 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/attachments/2/648/beast.jpg",size:"medium",alignment:"unaligned",isPlayer:!1,notes:`
