`,stats:{STR:21,DEX:15,CON:22,INT:15,WIS:16,CHA:20}},{id:"7jb5a2v52",name:"Doppelganger",hp:52,AC:14,type:"monstrosity",speed:30,speedSwim:10,speedFly:0,immunities:["Charmed"],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Deception +6","Insight +3"],senses:["Darkvision 60 ft.","Passive Perception 11"],challenge:"3 (700 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/289/315/315/636252770983164351.jpeg",size:"medium",alignment:"neutral",isPlayer:!1,notes:`
