`,stats:{STR:10,DEX:12,CON:13,INT:12,WIS:15,CHA:11}},{id:"z763ud29s",name:"Dryad",hp:22,AC:11,type:"fey",speed:30,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Perception +4","Stealth +5"],senses:["Darkvision 60 ft.","Passive Perception 14"],challenge:"1 (200 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/307/1000/1000/636252771953950206.jpeg",size:"medium",alignment:"neutral",isPlayer:!1,notes:`
