`,stats:{STR:19,DEX:14,CON:17,INT:14,WIS:11,CHA:16}},{id:"ruq4amhbg",name:"Gorgon",hp:114,AC:19,type:"monstrosity",speed:40,speedSwim:10,speedFly:0,immunities:["Petrified"],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Perception +4"],senses:["Darkvision 60 ft.","Passive Perception 14"],challenge:"5 (1,800 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/355/315/315/636252778125099430.jpeg",size:"large",alignment:"unaligned",isPlayer:!1,notes:`
