`,stats:{STR:15,DEX:12,CON:13,INT:14,WIS:11,CHA:13}},{id:"pheqidlgx",name:"Green Hag",hp:82,AC:17,type:"fey",speed:30,speedSwim:10,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Arcana +3","Deception +4","Perception +4","Stealth +3"],senses:["Darkvision 60 ft.","Passive Perception 14"],challenge:"3 (700 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/365/315/315/636252778948574879.jpeg",size:"medium",alignment:"neutral evil",isPlayer:!1,notes:`
