`,stats:{STR:13,DEX:12,CON:12,INT:10,WIS:11,CHA:10}},{id:"0saiqkvrp",name:"Guardian Naga",hp:127,AC:18,type:"monstrosity",speed:40,speedSwim:10,speedFly:0,immunities:["Poison","Charmed","Poisoned"],resistances:[],vulnerabilities:[],savingThrows:["DEX +8","CON +7","INT +7","WIS +8","CHA +8"],skills:[],senses:["Darkvision 60 ft.","Passive Perception 14"],challenge:"10 (5,900 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/377/315/315/636252780447421771.jpeg",size:"large",alignment:"lawful good",isPlayer:!1,notes:`
