`,stats:{STR:13,DEX:12,CON:12,INT:10,WIS:10,CHA:9}},{id:"p1mywv1i2",name:"Homunculus",hp:5,AC:13,type:"construct",speed:20,speedSwim:10,speedFly:40,immunities:["Poison","Charmed","Poisoned"],resistances:[],vulnerabilities:[],savingThrows:[],skills:[],senses:["Darkvision 60 ft.","Passive Perception 10"],challenge:"0 (10 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/18/287/315/315/636379803928245506.jpeg",size:"tiny",alignment:"neutral",isPlayer:!1,notes:`
