`,stats:{STR:8,DEX:15,CON:11,INT:3,WIS:12,CHA:6}},{id:"ksj4uw71v",name:"Killer Whale",hp:90,AC:12,type:"beast",speed:0,speedSwim:60,speedFly:0,immunities:[],resistances:[],vulnerabilities:[],savingThrows:[],skills:["Perception +3"],senses:["Blindsight 120 ft.","Passive Perception 13"],challenge:"3 (700 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/attachments/2/648/beast.jpg",size:"huge",alignment:"unaligned",isPlayer:!1,notes:`
