`,stats:{STR:16,DEX:10,CON:12,INT:2,WIS:11,CHA:7}},{id:"t8qfhu372",name:"Roc",hp:248,AC:15,type:"monstrosity",speed:20,speedSwim:10,speedFly:120,immunities:[],resistances:[],vulnerabilities:[],savingThrows:["DEX +4","CON +9","WIS +4","CHA +3"],skills:["Perception +4"],senses:["Passive Perception 14"],challenge:"11 (7,200 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/229/315/315/636252765590929622.jpeg",size:"gargantuan",alignment:"unaligned",isPlayer:!1,notes:`
**TRAITS**

<p><em><strong>Keen Sight.</strong></em> The roc has advantage on Wisdom (Perception) checks that rely on sight.</p>

