`,stats:{STR:14,DEX:10,CON:14,INT:5,WIS:10,CHA:11}},{id:"mzndhk2mo",name:"Wight",hp:45,AC:14,type:"undead",speed:30,speedSwim:10,speedFly:0,immunities:["Poison","Exhaustion","Poisoned"],resistances:["Necrotic; Bludgeoning","Piercing","and Slashing from Nonmagical Attacks that aren't Silvered"],vulnerabilities:[],savingThrows:[],skills:["Perception +3","Stealth +4"],senses:["Darkvision 60 ft.","Passive Perception 13"],challenge:"3 (700 XP)",imgUrl:"https://media-waterdeep.cursecdn.com/avatars/thumbnails/0/56/315/315/636252726349692861.jpeg",size:"medium",alignment:"neutral evil",isPlayer:!1,notes:`
